import React, { Component } from 'react'
import PostData from './data.json';
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import ButtonBase from "@material-ui/core/ButtonBase";
import './readJSON.css';
import Logo from './images/myhome.svg'
import Chip from '@material-ui/core/Chip';




class readJSON extends Component {
    render () {
    
        return(
            <div className="list">
          
            {PostData.map((postDetail, index) => {
                return(
                    <Paper className="paper">
                      <Grid container spacing={2}>
                        <Grid item>
                          <ButtonBase>
                            <img alt={postDetail.id} src={Logo} />
                          </ButtonBase>
                        </Grid>
                        <Grid item xs={12} sm container>
                          <Grid item xs container direction="column" spacing={2}>
                            <Grid item xs>
                              <Typography gutterBottom variant="body2">
                                {postDetail.company}
                              </Typography>
                              <Typography variant="subtitle1" gutterBottom>
                                {postDetail.position}
                              </Typography>
                              <Typography variant="body2" color="textSecondary">
                                {postDetail.contract}, {postDetail.location}
                              </Typography>
                              <Typography variant="body2">
                                {postDetail.postedAt}
                              </Typography>

                            </Grid>
                          </Grid>
                        </Grid>
                        <Grid item xs container direction ="row" spacing={20}>
                              {postDetail.languages.map((PostLanguages)=>{
                                return <Chip className ="chip" label={PostLanguages} variant="outlined" />
                              })} 
                        </Grid>
                      </Grid>
                    </Paper>
                )
            })}

        </div>
        )
    }
}

export default readJSON
